Taking a leap of faith.

Right now the recovery process feels like one step forward, two steps back. I’m almost always working towards a challenge of some sort, but after so many setbacks it’s hard to fully commit to anything without a stable foundation to start from.

Flashback to 2013 with chronic shin pain that stopped me running for nearly a year. I'll never forget the orthopaedic consultant shrugging shoulders and telling me I "might never get back to running at my old level". So, I set the goal of climbing Everest in 2014. That gave less than 18 months to make it happen, finish my A-levels and climb a 7,000m peak in prep. That's probably not what the Doc had in mind… 

But there’s something powerful about commitment. If we don’t take control of a situation, it will take control of us. I have a few ideas on standby, so maybe it's time to set the date and hope for the best.

