Sometimes you have to throw yourself in the deep end.

Less than 3 weeks until the Frog Graham Round. Last night was a recce on leg 4 - 11 miles of running from Buttermere and a 1 mile solo swim across Derwentwater. It was nearly 9pm, the water temps have dropped with all the rain, and my head was definitely in the wrong place. But if I can't do it now, then I definitely won't feel like it after 38 miles of running on the big day. Sometimes you just have to get it done. 

Getting calf cramp on the 3rd island across was a good reminder to always bring a tow float. Donate just £3 and I'll send you the video... 

Now my head is in a better place. Please help me hit the target for @mindomountains so everyone can get the mental health support they deserve. Link in bio! 🙏

